import React from 'react';

export default class Coin extends React.Component{
	constructor(name, props){
		super(props); 
		this.name = name;
		this.state = {
			data: {}
		}
	}

	render() { 
		return(
			<div>
				<h1>{this.name}</h1>
				<ul>
					<li>{this.state.price}</li>
					<li>{this.state.change}</li>
					<li>{this.state.last_updated}</li>
				</ul>
			</div>
		);
	}
}
